			["162804"] = {
				["quotes"] = {
					["CHAT_MSG_MONSTER_SAY"] = {
						["Now that the Jailer's noticed you, you're doomed. Anything of import you do in the Maw will catch his attention. And attention is exactly what we don't want."] = true,
						["Rule 2: Keep a low profile. The Maw is no place for theatrics. Get in, get what you want, and get out... while endeavoring to retain your limbs and other possessions."] = true,
						["Rule 4: Maintain a list of those who might wish to end your existence. Do not flatter yourself; your presence on this list is among the least of the Mawsworn's functionaries."] = true,
						["First he'll turn the soulseekers on you. Then the towers. Then his kill squads. And after that... well, you don't want to know. Surgical and meticulous--that's how you stay alive."] = true,
						["It is remarkable what you can find discarded in the Maw. I pride myself on recognizing a valuable asset when I see one."] = true,
						["Rule 1: Always have an exit strategy. To ensure one's continued existence within the Maw, one must maintain a plan of escape at all times."] = true,
						["Rule 3: Trust is earned, and information has a price. You recall the cypher I gave you? That's right--you are now in my debt."] = true,
						["At the top of my list is an Inquisitor. His position has risen. I would be most generous were his existence to cease by your actions."] = true,
						["The good news is that you're safe here in my refuge. Not so out there. Remember, should a tragic fate befall you, some of that precious stygia might slip through your fingers."] = true,
						["Torghast, eh? Once I told you that your friends were being held inside, I knew it was only a matter of time before you came to me for aid."] = true,
						["I will dispense with the usual warnings and disclaimers, as your unique combination of courage and foolhardiness would render them moot."] = true,
						["Fret not, mortal. A day at most away from his gaze, and the Jailer will turn his attention elsewhere. Then it will be safe for you to venture out again. To acquire stygia. For me."] = true,
						["Tread carefully when the Eye of the Jailer falls upon you, mortal. It would be frightfully inconvenient to lose a trading partner with such potential!"] = true,
						["You really shouldn't linger here. The Jailer doesn't like having his toys taken away... even ones he discarded. Go on. Back to Oribos with you!"] = true,
						["Do not ask how it was obtained. Simply consider it a gesture of goodwill that you are now obligated to repay. I look forward to our future transactions, Maw Walker."] = true,
						["Because I was able to anticipate your request, it just so happens I have already acquired a portal device that leads into the tower."] = true,
					},
				},
